ite"}, "id": "4:0658720f-ad9e-48e1-a121-81d15220aeb0:5942", "label": "Steve Jobs", "mass": 1.3, "shape": "dot", "size": 20, "title": "{\n  \"properties\": {\n    \"confidence\": 1.0,\n    \"extracted_from_session\": \"sess_1760013657434\",\n    \"id\": \"entity_7f76ff86\",\n    \"text\": \"Steve Jobs\",\n    \"variants\": [\n      \"Steve Jobs\"\n    ],\n    \"type\": \"extracted_entity\"\n  },\n  \"labels\": [\n    \"ExtractedEntity\",\n    \"PERSON\"\n  ]\n}"}, {"borderWidth": 1, "color": "#FFDFBA", "font": {"color": "white"}, "id": "4:0658720f-ad9e-48e1-a121-81d15220aeb0:5956", "label": "Apple Computer Company, now ...", "mass": 6.8, "shape": "dot", "size": 44, "title": "{\n  \"properties\": {\n    \"topic\": \"query\",\n    \"id\": \"mem_1760013887030\",\n    \"text\": \"Apple Computer Company, now simply known as Apple Inc., was founded by **Steve Jobs, Steve Wozniak, and Ronald Wayne** on **April 1, 1976**, in Los Altos, California.\\n\\nHere\u0027s a breakdown of the key events:\\n\\n* **Early Days:**  Jobs, inspired by the potential of personal computers, convinced his friend Wozniak, a brilliant engineer, to build one. They initially called their company \\\"Apple Computer Company\\\" after Jobs\u0027 favorite fruit.\\n* **The Apple I:** Wozniak designed and built the first Apple computer, the Apple I, a motherboard with basic components that users had to assemble themselves. It was sold for $666.66 in 1976.\\n* **Ronald Wayne\u0027s Departure:**  Wayne, who initially contributed to the company\u0027s early paperwork and business plan, sold his 10% stake back to Jobs and Wozniak for just $800 shortly after the company\u0027s founding. He later expressed regret over this decision.\\n* **The Apple II:** The success of the Apple I led them to develop the Apple II, a more user-friendly computer with color graphics and a keyboard. This became a major hit, selling thousands of units and establishing Apple as a serious player in the burgeoning personal computer market.\\n\\n**Key Factors Contributing to Apple\u0027s Success:**\\n\\n* **Innovation:** Wozniak\u0027s technical brilliance and Jobs\u0027 visionary leadership drove the creation of groundbreaking products.\\n* **User-Friendliness:**  Apple focused on making computers accessible to everyone, not just tech experts.\\n* **Marketing and Design:** Jobs understood the importance of aesthetics and marketing. Apple\u0027s products were sleek, stylish, and well-marketed.\\n\\nThe founding of Apple marked a pivotal moment in the history of personal computing. It laid the groundwork for the company\u0027s future dominance and its impact on technology and culture worldwide.\\n\\n\\nLet me know if you have any other questions about Apple\u0027s history!\",\n    \"type\": \"Query\"\n  },\n  \"labels\": [\n    \"Query\"\n  ]\n}"}, {"borderWidth": 1, "color": "#FFCBA4", "font": {"color": "white"}, "id": "4:0658720f-ad9e-48e1-a121-81d15220aeb0:5996", "label": "the history", "mass": 1.2, "shape": "dot", "size": 19, "title": "{\n  \"properties\": {\n    \"confidence\": 0.7,\n    \"extracted_from_session\": \"sess_1760013657434\",\n    \"id\": \"entity_369cc059\",\n    \"text\": \"the history\",\n    \"variants\": [\n      \"the history\"\n    ],\n    \"type\": \"extracted_entity\"\n  },\n  \"labels\": [\n    \"ExtractedEntity\",\n    \"NOUN_CHUNK\"\n  ]\n}"}, {"borderWidth": 1, "color": "#FFCBA4", "font": {"color": "white"}, "id": "4:0658720f-ad9e-48e1-a121-81d15220aeb0:6001", "label": "any other questions", "mass": 1.2, "shape": "dot", "size": 19, "title": "{\n  \"properties\": {\n    \"confidence\": 0.7,\n    \"extracted_from_session\": \"sess_1760013657434\",\n    \"id\": \"entity_dc712fe9\",\n    \"text\": \"any other questions\",\n    \"variants\": [\n      \"any other questions\"\n    ],\n    \"type\": \"extracted_entity\"\n  },\n  \"labels\": [\n    \"ExtractedEntity\",\n    \"NOUN_CHUNK\"\n  ]\n}"}, {"borderWidth": 1, "color": "#FFCBA4", "font": {"color": "white"}, "id": "4:0 he importance", "mass": 1.2, "shape": "dot", "size": 19, "title": "{\n  \"properties\": {\n    \"confidence\": 0.7,\n    \"extracted_from_session\": \"sess_1760013657434\",\n    \"id\": \"entity_60094564\",\n    \"text\": \"the importance\",\n    \"variants\": [\n      \"the importance\"\n    ],\n    \"type\": \"extracted_entity\"\n  },\n  \"labels\": [\n    \"ExtractedEntity\",\n    \"NOUN_CHUNK\"\n  ]\n}"}, {"borderWidth": 1, "color": "#FFCBA4", "font": {"color": "white"}, "id": "4:0658720f-ad9e-48e1-a121-81d15220aeb0:5994", "label": "aesthetics", "mass": 1.2, "shape": "dot", "size": 19, "title": "{\n  \"properties\": {\n    \"confidence\": 0.7,\n    \"extracted_from_session\": \"sess_1760013657434\",\n    \"id\": \"entity_8bade7ce\",\n    \"text\": \"aesthetics\",\n    \"variants\": [\n      \"aesthetics\"\n    ],\n    \"type\": \"extracted_entity\"\n  },\n  \"labels\": [\n    \"ExtractedEntity\",\n    \"NOUN_CHUNK\"\n  ]\n}"}, {"borderWidth": 1, "color": "#FFCBA4", "font": {"color": "white"}, "id": "4:0658720f-ad9e-48e1-a121-81d15220aeb0:5995", "label": "a pivotal moment", "mass": 1.2, "shape": "dot", "size": 19, "title": "{\n  \"properties\": {\n    \"confidence\": 0.7,\n    \"extracted_from_session\": \"sess_1760013657434\",\n    \"id\": \"entity_8a369e12\",\n    \"text\": \"a pivotal moment\",\n    \"variants\": [\n      \"a pivotal moment\"\n    ],\n    \"type\": \"extracted_entity\"\n  },\n  \"labels\": [\n    \"ExtractedEntity\",\n    \"NOUN_CHUNK\"\n  ]\n}"}, {"borderWidth": 1, "color": "#FFCBA4", "font": {"color": "white"}, "id": "4:0658720f-ad9e-48e1-a121-81d15220aeb0:6002", "label": "Apple Computer Company, now ...", "mass": 6.7, "shape": "dot", "size": 44, "title": "{\n  \"properties\": {\n    \"topic\": \"query\",\n    \"id\": \"mem_1760013910754\",\n    \"text\": \"Apple Computer Company, now simply known as Apple Inc., was founded by **Steve Jobs, Steve Wozniak, and Ronald Wayne** on **April 1, 1976**, in Los Altos, California.\\n\\nHere\u0027s a breakdown of the key events:\\n\\n* **Early Days:**  Jobs, inspired by the potential of personal computers, convinced his friend Wozniak, a brilliant engineer, to build one. They initially called their company \\\"Apple Computer Company\\\" after Jobs\u0027 favorite fruit.\\n* **The Apple I:** Wozniak designed and built the first Apple computer, the Apple I, a motherboard with basic components that users had to assemble themselves. It was sold for $666.66 in 1976.\\n* **Ronald Wayne\u0027s Departure:**  Wayne, who initially contributed to the company\u0027s early paperwork and business plan, sold his 10% stake back to Jobs and Wozniak for just $800 shortly after the company\u0027s founding. He later expressed regret over this decision.\\n* **The Apple II:** The success of the Apple I led them to develop the Apple II, a more user-friendly computer with color graphics and a keyboard. This became a major hit, selling thousands of units and establishing Apple as a serious player in the burgeoning personal computer market.\\n\\n**Key Factors Contributing to Apple\u0027s Success:**\\n\\n* **Innovation:** Wozniak\u0027s technical brilliance and Jobs\u0027 visionary leadership drove the creation of groundbreaking products.\\n* **User-Friendliness:**  Apple focused on making computers accessible to everyone, not just tech experts.\\n* **Marketing and Design:** Jobs understood the importance of aesthetics and marketing. Apple\u0027s products were sleek, stylish, and well-marketed.\\n\\nThe founding of Apple marked a pivotal moment in the history of personal computing. It laid the groundwork for the company\u0027s future dominance and its impact on technology and culture worldwide.\\n\\n\\nLet me know if you have any other questions about Apple\u0027s history!\",\n    \"type\": \"Response\"\n  },\n  \"labels\": [\n    \"Response\"\n  ]\n}"}]);
